# Definition for singly-linked list.

from typing import Optional

class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next

    def convertArrayToLinkedList(self , nums : list[int]):
        
        head = ListNode(nums[0])

        currentNode = head 

        i = 1

        while (i < len(nums)):
            newNode = ListNode(nums[i])
            currentNode.next = newNode
            currentNode = newNode
            i += 1
        
        return head

    def printLinkedList(self , head):

        currentNode = head

        while (currentNode.next != None):
            print(currentNode.val , end=" -> ")
            currentNode = currentNode.next 
        
        print(currentNode.val);




class Solution:

    def getLength(self , head:  Optional[ListNode]) -> int :
        
        length = 0

        currentNode = head

        while (currentNode != None):
            currentNode = currentNode.next
            length += 1
        
        return length
    
    def GotoMiddle(self , head : Optional[ListNode]) -> Optional[ListNode]:
        
        length = Solution().getLength(head)

        print(length)

        currentNode = head

        temp = length // 2

        while (temp != 0):
            currentNode = currentNode.next
            temp -= 1
        
        
        return currentNode

    def pairSum(self , head : Optional[ListNode]) -> int:

        # IDEA : 
        #let's say we have : 
        # 1 -> 2 -> 3 -> 4
        #the idea is to create another linked list which is : 
        # 3 -> 4 
        #then we make the sum 

        # reverse the other half of the linked list 

        middleNode = Solution().GotoMiddle(head)
        
        previous = None

        newhead = middleNode

        while (newhead != None):
            temp = newhead.next 
            newhead.next = previous
            previous = newhead 
            newhead = temp
        
        newhead = previous  
    
        # move over both Linked Lists and start comparaison

        Max = head.val + newhead.val 

        left = head.next 
        right = newhead.next

        while (right != None):
            value = left.val + right.val 

            if (value > Max):
                Max = value 
            
            left = left.next 
            right = right.next 
            
        return Max
            

